INSERT INTO capstone_pod.product (id,create_date,last_modified_date,description,is_deleted,is_public,name,category_id) VALUES
                                                                                                                           ('036814a2-1349-4c4a-b398-4e2387eea5b1','2022-07-05','2022-08-02','Áo Hoodie Unisex College Hoodie với Chất liệu Nỉ Ngoại tốt; mang phong cách thời trang thời thượng các bạn trẻ; đặc biệt không những giúp bạn giữ ấm trong mùa lạnh mà còn có thể chống nắng, chống gió, chống bụi, chống rét, chống tia UV cực tốt.',0,1,'Unisex College Hoodie','098202cb-1b60-4e0e-8da8-0da24e006a27'),
                                                                                                                           ('0eb0964d-bb4e-484a-af4b-8b6e1e4f67a1','2022-07-05','2022-08-02','Áo hoodie được làm từ chất liệu nỉ ngoại mềm mịn dày dặn, co giãn, thông thoáng, đảm bảo cảm giác thoải mái, dễ chịu khi mặc. Đường may tinh tế, tỉ mỉ trong từng chi tiết. Thiết kế đơn giản, dễ mặc, dễ phối đồ.  Chất lượng sản phẩm tốt, giá cả hợp lý. ',0,1,'Unisex Supply Hoodie','098202cb-1b60-4e0e-8da8-0da24e006a27'),
                                                                                                                           ('343fefbb-7a7d-4d2a-9e8e-a3614780f57d','2022-07-05','2022-08-02','Với đặc điểm dễ mặc dễ mix đồ, mặc cực thoải mái thoáng mát, lại mang đến vẻ quyến rũ không gì cưỡng nỗi. Cực xinh khi kết hợp với chân váy và áo khoác mỏng hoặc mặc kèm quần cạp cao. Khách hàng đều hài lòng 100% ngay khi nhận được hàng.',0,1,'Áo croptop LA','45d41519-a1b2-470a-b984-dfdc67c988fd'),
                                                                                                                           ('3974f4e3-7a01-472f-9e93-256b54168f8f','2022-07-05','2022-08-02','Unisex Cruiser Hoodie là sản phẩm mới nhất, chất liệu may tốt, được gia công trực tiếp tại Việt Nam. Form Basic cực kỳ dễ mặc, dễ phối đồ. Có thể mặc nhà hoặc đi chơi đều được.',0,0,'Unisex Cruiser Hoodie','098202cb-1b60-4e0e-8da8-0da24e006a27'),
                                                                                                                           ('481639ec-c394-479b-93ca-4bfe0f67b837','2022-07-05','2022-08-02','Sản phẩm này được làm từ sợi bông hữu cơ. Việc sản xuất loại sợi bông này giúp giảm thiểu tiêu thụ nước và hóa chất và giúp cho sản phẩm này thân thiện với môi trường và con người.',0,0,'Áo thun form nhỏ','c6750e7b-06ef-43af-a72c-b1e80509f7eb'),
                                                                                                                           ('4de82684-c0fe-496f-946d-d642ec91bee1','2022-07-05','2022-07-24','Áo thun fuser, hút mồ hôi tốt, thoải mái cho người hay vận động, phải thường xuyên di chuyển trong môi trường nóng bức',0,0,'Áo thun fuser','c6750e7b-06ef-43af-a72c-b1e80509f7eb'),
                                                                                                                           ('61b6c9a6-c12c-41bd-91ad-d799dd476abb','2022-07-05','2022-08-02',' Với chất liệu thun cực mát, thấm hút tốt, sản phẩm sẽ mang đến cho bạn cảm giác dễ chịu và thoải mái những lúc nghỉ ngơi, thư giãn tại nhà.và những lúc bạn đi chơi,đi dạo,đi shop.',0,0,'Áo thun nữ','918514cc-c325-4e97-8d17-7c9b26db39ec'),
                                                                                                                           ('782b3189-bff2-4751-8e6f-0a7d5c824e61','2022-07-05','2022-08-02','Áo hoodies champion mới cho mùa thu đông  này. Với form rộng dáng thụng mặc cực thích, layer rách và chun cổ áo + tay áo tinh tế tạo điểm nhấn đặc biệt. Chất liệu nỉ bông  mịn mặc cực thích, ae diện đôi hoặc mặc nhóm cùng đi học, đi chơi hay đi du lịch',0,0,'Áo hoodies champion','098202cb-1b60-4e0e-8da8-0da24e006a27'),
                                                                                                                           ('85d4c7a8-edd9-43db-9176-dc3ed7634665','2022-07-05','2022-08-02','Streeter Hoodie Dress, với đường may liền, mảnh dài qua hông, thể hiện phong cách casual nên rất thích hợp cho các hoạt động ngoại khóa ngoài trời, đi học, đi làm và đi chơi cùng gia đình hoặc bạn bè.',0,0,'Streeter Hoodie Dress','098202cb-1b60-4e0e-8da8-0da24e006a27'),
                                                                                                                           ('87334855-3594-4a7f-89d7-b2eae7c6129e','2022-07-05','2022-08-02','Tuy là sản phẩm tự gia công, số lượng thường sẽ không nhiều, nhưng áo thun PODOC luông đảm bảo về chất lương cho người dùng. Với chất liệu cotton, thoáng khí, hút mồ hôi và đặc biệt không bị phai màu.',0,1,'Áo thun PODOC','c6750e7b-06ef-43af-a72c-b1e80509f7eb'),
                                                                                                                           ('8a3e8974-2df8-4edd-ac2d-aef26ce79bc9','2022-07-11','2022-08-02','Chất liệu dày dặn, mềm mịn, thích hợp mặc mùa thu đông, tiết trời se se lạnh Kiểu dáng hoodie chui đầu có mũ trùm cá tính. Họa tiết in hoa cúc mặt lưng sắc nét, không phai màu.',0,0,'Unisex Heavy Blend Hooded','098202cb-1b60-4e0e-8da8-0da24e006a27'),
